7	emissao	0002/2026	2026-01-13	Adra Uberlndia	Adriano Martins Torres	Secretaria de Planejamento Urbano	Entrega presencial	10		Secretaria de Planejamento Urbano	data:image/jpeg;base64,		Sra.	Pedido de Regularizao de Terreno 	A Proponente ADRA Agncia Adventista de Desenvolvimento e Recursos Assistenciais Sudeste Brasileira, inscrita CNPJ 16.524.054/0006-09, e certificada como OSCIP Organizao da Sociedade Civil de Interesse Pblico atravs do processo MJ No. 08071.002538/2012-79, por meio do seu representante legal, vem encaminhar a sua secretaria pedido para regularizao de terreno concedido pela Prefeitura Municipal de Uberlndia.\nNo dia 08 de julho de 1986 o terreno situado no conjunto habitacional Luizote de Freitas na Rua Joo Batista Coelho, 50 (lote 15 e 16) medindo 30 metros de frente por 24 de extenso foi cedido para o Centro Educacional Adventista de Uberlndia, CNPJ: 30.097.554/0104-25, uma instituio do Grupo Adventista na qual foi destinado para a construo de uma escola para atender a comunidade do bairro, o terreno est registrado  no cartrio do 2 ofcio de imveis da cidade de Uberlndia sob a matrcula A-MATRCULA-34.143-08/07/86 onde foi feito a unificao dos lotes 15 e 16.\nA escola foi construda toda conforme documentao do projeto assinado em 07/08/1986 sob o Assessor de Municipal de Planejamento Arquiteto Crea 87.958/DSP Sr. Jos Antnio Assis de Godoy na Administrao do Prefeito Zaire Rezende e sob o alvar de licena de funcionamento n 2767 de 11/07/1986 conforme documento anexo.\nCom o passar de alguns anos ficou pequeno a rea recebida para os projetos no qual foi destinada fazendo que a instituio solicitasse a prefeitura o lote dos fundos para ampliar suas instalaes, no entanto a prefeitura cedeu mais um lote designado por lote 13 da rua C14 totalizando a rea de 360 m2. a concesso de direito real de uso do imovel descrito autorizando conceder  a instituio Adventista e Assistncia Social o uso para a construo de um centro de treinamento para pessoas carentes de acordo com o artigo 2 da Lei 9.809 de 25 de abril de 2008.\n\tEm um determinado momento foi contratado um contador para assumir as responsabilidades fiscais e tributrias do grupo, no entanto este contador fez a baixa indevida dos CNPJs que eram atribudos  concesso dos terrenos.\n\tDo terreno da C15 n 50 foi feito a baixa do cnpj em 22/08/1995\n\tDo terreno da C14 foi feito a baixa do cnpj em 03/02/2021\ndos cnpjs baixados foi criado um cnpj nico que  o 16.524.054/0006-09 constituda como Agncia Adventista de Desenvolvimento e Recursos Assistenciais Sudeste Brasileira - Adra Ncleo Uberlndia, neste perodo a escola Adventista passou a funcionar nas dependncias central que hoje funciona na Rua Jorge Martins Pinto 272, Escola Adventista no bairro Santa Mnica nesta cidade e nas dependncias dos terrenos mantm o trabalho assistencial da Adra Ncleo Uberlndia.\nEsta fuso foi necessria para a melhor distribuio e atendimento s famlias com vulnerabilidade social.\nNeste caso, diante do exposto temos a dificuldade de emitir o alvar definitivo da instituio pelo fato do CNPJ est baixado, solicitamos diante dos fatos a regularizao dos terrenos para a nova nomenclatura da instituio social do grupo Adventista, Adra Ncleo Uberlndia.\nPedimos o deferimento desta solicitao para a regularizao imediata da instituio para que possamos dar continuidade em nossos atendimentos  comunidade de forma totalmente regular.\nAgradeo desde j a ateno dispensada a esta solicitao e aguardo orientaes sobre os prximos passos a serem seguidos para a regularizao do terreno.\nEstamos  disposio para esclarecer qualquer dvida ou fornecer informaes adicionais que se faam necessrias. Agradecemos desde j pela confiana depositada em nossa instituio/organizao e pelo apoio contnuo s nossas iniciativas.\n\n	Sem mais para o momento, colocamo-nos  inteira disposio de Vossa Senhoria para quaisquer esclarecimentos que se faam necessrios, reiterando protestos de elevada estima e considerao	Adriano Martins Torres	Coordenador Geral	CNPJ: 16.524.054/0006-09 - Rua Joo Batista Coelho - n 50 - Bairro Luizote De Freitas - CEP: 38414-234\nUberlndia - MG - Telefone: (34) 3224-3328 - E-mail: adrauberlandia@gmail.com - Site: adra.ogr.br	Recebido		\N		\N			\N	\N	2026-01-13 00:19:04.67936	2026-01-21 10:33:56.702105	Roberta Braga de Paula Nogueira	Secretria	\N	\N	\N
